import React, { Component, useState, useEffect } from "react";
import axios from "axios";

const CreateUser = () => {
  const [userName, setUser] = useState("");
  const postUser = (e) => {
    e.preventDefault();
    axios.post("http://localhost:8080/add").then((res) => {
      console.log(res);
      setUser(res.data);
    });
  };
  useEffect(() => {
    postUser();
  }, []);

  return (
    <div>
      <h2>Add user</h2>
      <form onSubmit={postUser}>
        <label>Name</label>
        <input
          type="text"
          requried
          value={userName}
          onChange={(e) => setUser(e.target.value)}
        ></input>
        <button type="submit" action="PostUser">
          Add
        </button>
        <p>{userName}</p>
      </form>
    </div>
  );
};

export default CreateUser;
